import React from 'react';
import {Typography, AppBar, Toolbar, Button} from "@material-ui/core";
import CustomizedDialogs from './addModal';
import AddForm from './addform';
import EditModal from './editmodal';
import EditForm from './editForm';
import DeleteModal from './deleteModal';
import { ThemeContext } from './themeContext';

class Header3 extends React.Component{
    state = { 
        dark:'2A3E4C'
        }
    render(){
        console.log(this.state.dark);
            return( 
            <AppBar position="static" style={{background:this.dark}}>   
                <Toolbar>
                    <Typography variant="h6" style={{flexGrow: 1}}>
                        <Button variant="outlined" color="secondary" >Predict</Button>
                        <Button variant="outlined" color="secondary">View Correspondence</Button>
                    </Typography>
                    <Button  color="secondary"><CustomizedDialogs><AddForm/> </CustomizedDialogs></Button> 
                    <Button color="secondary"><EditModal><EditForm /></EditModal></Button> 
                    <Button color="secondary"><DeleteModal /></Button> 
                </Toolbar>
            </AppBar>
        )
    }
}
export default Header3;
